<?phpclass VlistItemVO {		public $_explicitType =  "lib.filemaker.vo.VlistItemVO";		public $id;	public $value;	public $name;		public function __construct($nam,$val,$id) {		$this->value	= $val;		$this->name		= $nam;		$this->id		= $id;	}		public function __set_state ( $assoc ) {		$this->value	= (string)	$assoc->value;		$this->id		= (string)	$assoc->id;		$this->name		= (string)	$assoc->name;	}}?>